// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title VotingSystemFixed
 * @dev Fixed version that eliminates data inconsistency issues
 * Key improvements:
 * - Single source of truth for all voter data
 * - Atomic state updates
 * - Comprehensive validation
 * - Consistent method behavior
 */
contract VotingSystemFixed {

    // ============ STATE VARIABLES ============

    address public owner;
    address public nikOracle;

    // Reentrancy protection
    bool private locked;
    modifier noReentrant() {
        require(!locked, "Reentrant call");
        locked = true;
        _;
        locked = false;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    // ============ ENUMS & STRUCTS ============

    enum VoterStatus { 
        NotRegistered,      // 0
        PendingVerification,// 1  
        Registered,         // 2
        Voted              // 3
    }

    struct Election {
        uint256 id;
        string name;
        string description;
        uint256 startTime;
        uint256 endTime;
        uint256 candidateCount;
        uint256 totalVotes;
        bool active;
        address creator;
        bool exists; // Add existence flag
    }

    struct Candidate {
        uint256 id;
        uint256 electionId;
        string name;
        string details;
        uint256 voteCount;
        bool exists; // Add existence flag
    }

    // ⭐ CRITICAL: Single source of truth for voter data
    struct Voter {
        string name;
        string nikHash;
        VoterStatus status;
        uint256 votedFor;     // Candidate ID (0 = no vote)
        uint256 voteTimestamp; // When they voted
        bool nikVerified;
        bool exists;          // Voter exists flag
    }

    // ============ STORAGE ============

    uint256 public electionCount;
    uint256 private candidateCount;

    // Main mappings - single source of truth
    mapping(uint256 => Election) public elections;
    mapping(uint256 => Candidate) public candidates;
    mapping(uint256 => uint256[]) public electionCandidates;

    // ⭐ SINGLE SOURCE: All voter data in one mapping
    mapping(uint256 => mapping(address => Voter)) public electionVoters;

    // NIK usage tracking
    mapping(string => bool) public usedNIKHashes;

    // ============ EVENTS ============

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    event ElectionCreated(uint256 indexed electionId, string name, uint256 startTime, uint256 endTime, address creator);
    event CandidateAdded(uint256 indexed electionId, uint256 indexed candidateId, string name, string details);
    event VoterRegistrationRequested(uint256 indexed electionId, address indexed voter, bytes32 requestId);
    event VoterVerified(uint256 indexed electionId, address indexed voter, bool verified);
    event VoteSubmitted(uint256 indexed electionId, uint256 indexed candidateId, address indexed voter, uint256 timestamp);
    event ElectionStatusChanged(uint256 indexed electionId, bool active);

    // ============ CONSTRUCTOR ============

    constructor() {
        owner = msg.sender;
        electionCount = 0;
        candidateCount = 0;
        locked = false;
        emit OwnershipTransferred(address(0), msg.sender);
    }

    // ============ MODIFIERS ============

    modifier validElection(uint256 _electionId) {
        require(_electionId > 0 && _electionId <= electionCount, "Invalid election ID");
        require(elections[_electionId].exists, "Election does not exist");
        _;
    }

    modifier validCandidate(uint256 _candidateId) {
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");
        require(candidates[_candidateId].exists, "Candidate does not exist");
        _;
    }

    modifier voterExists(uint256 _electionId, address _voter) {
        require(electionVoters[_electionId][_voter].exists, "Voter not registered");
        _;
    }

    // ============ OWNERSHIP FUNCTIONS ============

    function setOracleAddress(address _oracleAddress) external onlyOwner {
        nikOracle = _oracleAddress;
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "Invalid address");
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }

    // ============ ELECTION MANAGEMENT ============

    function createElection(
        string memory _name,
        string memory _description,
        uint256 _startTime,
        uint256 _endTime
    ) external returns (uint256) {
        require(_startTime < _endTime, "Invalid time range");
        require(_endTime > block.timestamp, "End time in past");
        require(bytes(_name).length > 0, "Name required");

        electionCount++;
        uint256 electionId = electionCount;

        // ⭐ ATOMIC: Set all election data at once
        Election storage newElection = elections[electionId];
        newElection.id = electionId;
        newElection.name = _name;
        newElection.description = _description;
        newElection.startTime = _startTime;
        newElection.endTime = _endTime;
        newElection.candidateCount = 0;
        newElection.totalVotes = 0;
        newElection.active = true;
        newElection.creator = msg.sender;
        newElection.exists = true; // Mark as exists

        emit ElectionCreated(electionId, _name, _startTime, _endTime, msg.sender);
        return electionId;
    }

    function addCandidate(
        uint256 _electionId,
        string memory _name,
        string memory _details
    ) external validElection(_electionId) {
        require(elections[_electionId].creator == msg.sender, "Only creator");
        require(block.timestamp < elections[_electionId].startTime, "Election started");
        require(bytes(_name).length > 0, "Name required");

        candidateCount++;
        uint256 candidateId = candidateCount;

        // ⭐ ATOMIC: Set all candidate data at once
        Candidate storage newCandidate = candidates[candidateId];
        newCandidate.id = candidateId;
        newCandidate.electionId = _electionId;
        newCandidate.name = _name;
        newCandidate.details = _details;
        newCandidate.voteCount = 0;
        newCandidate.exists = true; // Mark as exists

        // Update election candidate count and list atomically
        elections[_electionId].candidateCount++;
        electionCandidates[_electionId].push(candidateId);

        emit CandidateAdded(_electionId, candidateId, _name, _details);
    }

    // ============ VOTER REGISTRATION ============

    function registerVoter(
        uint256 _electionId,
        string memory _name,
        string memory _nik
    ) external noReentrant validElection(_electionId) {
        require(bytes(_name).length > 0, "Name required");
        require(bytes(_nik).length == 16, "NIK must be 16 digits");
        require(!electionVoters[_electionId][msg.sender].exists, "Already registered");

        // Validate NIK is numeric
        bytes memory nikBytes = bytes(_nik);
        for (uint i = 0; i < nikBytes.length; i++) {
            require(nikBytes[i] >= 0x30 && nikBytes[i] <= 0x39, "NIK must be numeric");
        }

        // Create NIK hash
        bytes32 nikHashBytes = keccak256(abi.encodePacked(_nik, msg.sender));
        string memory nikHash = string(abi.encodePacked(nikHashBytes));

        require(!usedNIKHashes[nikHash], "NIK already used");
        usedNIKHashes[nikHash] = true;

        // Create request ID
        bytes32 requestId = keccak256(abi.encodePacked(msg.sender, _nik, block.timestamp, block.number));

        // ⭐ ATOMIC: Set ALL voter data at once - no partial updates!
        Voter storage newVoter = electionVoters[_electionId][msg.sender];
        newVoter.name = _name;
        newVoter.nikHash = nikHash;
        newVoter.status = VoterStatus.Registered; // Skip verification for demo
        newVoter.votedFor = 0; // No vote yet
        newVoter.voteTimestamp = 0; // No vote timestamp yet
        newVoter.nikVerified = true; // Auto-verify for demo
        newVoter.exists = true; // Mark as exists

        emit VoterRegistrationRequested(_electionId, msg.sender, requestId);
        emit VoterVerified(_electionId, msg.sender, true);
    }

    // ============ VOTING FUNCTIONS ============

    function castVote(uint256 _electionId, uint256 _candidateId) 
        external 
        noReentrant 
        validElection(_electionId) 
        validCandidate(_candidateId)
        voterExists(_electionId, msg.sender)
    {
        Election storage election = elections[_electionId];
        Voter storage voter = electionVoters[_electionId][msg.sender];
        Candidate storage candidate = candidates[_candidateId];

        // ⭐ COMPREHENSIVE VALIDATION - All checks before any state changes
        require(election.active, "Election not active");
        require(block.timestamp >= election.startTime, "Not started");
        require(block.timestamp <= election.endTime, "Ended");
        require(voter.status == VoterStatus.Registered, "Not registered");
        require(voter.nikVerified, "Not verified");
        require(voter.votedFor == 0, "Already voted"); // Check vote data directly
        require(candidate.electionId == _electionId, "Candidate not in this election");

        // ⭐ ATOMIC STATE UPDATE - All changes happen together
        uint256 voteTimestamp = block.timestamp;

        // Update voter data atomically
        voter.status = VoterStatus.Voted;
        voter.votedFor = _candidateId;
        voter.voteTimestamp = voteTimestamp;

        // Update candidate and election counters atomically
        candidate.voteCount++;
        election.totalVotes++;

        emit VoteSubmitted(_electionId, _candidateId, msg.sender, voteTimestamp);
    }

    // ============ VIEW FUNCTIONS - CONSISTENT DATA ACCESS ============

    /**
     * @dev Get voter status - reads from single source
     */
    function voterStatus(uint256 _electionId, address _voter) 
        external 
        view 
        validElection(_electionId)
        returns (VoterStatus) 
    {
        return electionVoters[_electionId][_voter].status;
    }

    /**
     * @dev Get comprehensive voter status with verification info
     */
    function getVoterStatus(uint256 _electionId, address _voter) 
        external 
        view 
        validElection(_electionId)
        returns (VoterStatus status, bool verified) 
    {
        Voter memory voter = electionVoters[_electionId][_voter];
        return (voter.status, voter.nikVerified);
    }

    /**
     * @dev Get user's vote - FIXED: consistent with voter status
     */
    function getUserVote(uint256 _electionId, address _voter) 
        external 
        view 
        validElection(_electionId)
        returns (uint256) 
    {
        Voter memory voter = electionVoters[_electionId][_voter];

        // ⭐ CONSISTENT CHECK: Use same data source as voterStatus
        require(voter.exists, "Voter not registered");
        require(voter.status == VoterStatus.Voted, "Not voted");
        require(voter.votedFor != 0, "No vote recorded"); // Extra safety check

        return voter.votedFor;
    }

    /**
     * @dev Get user's vote timestamp
     */
    function getUserVoteTimestamp(uint256 _electionId, address _voter) 
        external 
        view 
        validElection(_electionId)
        returns (uint256) 
    {
        Voter memory voter = electionVoters[_electionId][_voter];

        require(voter.exists, "Voter not registered");
        require(voter.status == VoterStatus.Voted, "Not voted");
        require(voter.voteTimestamp != 0, "No timestamp recorded");

        return voter.voteTimestamp;
    }

    /**
     * @dev Get complete voter information - for debugging and transparency
     */
    function getVoterInfo(uint256 _electionId, address _voter) 
        external 
        view 
        validElection(_electionId)
        returns (
            string memory name,
            VoterStatus status,
            bool nikVerified,
            uint256 votedFor,
            uint256 voteTimestamp,
            bool exists
        ) 
    {
        Voter memory voter = electionVoters[_electionId][_voter];
        return (
            voter.name,
            voter.status,
            voter.nikVerified,
            voter.votedFor,
            voter.voteTimestamp,
            voter.exists
        );
    }

    // ============ ELECTION VIEW FUNCTIONS ============

    function getElectionCandidates(uint256 _electionId) 
        external 
        view 
        validElection(_electionId)
        returns (uint256[] memory) 
    {
        return electionCandidates[_electionId];
    }

    function getCandidateInfo(uint256 _candidateId) 
        external 
        view 
        validCandidate(_candidateId)
        returns (uint256, string memory, string memory, uint256) 
    {
        Candidate memory candidate = candidates[_candidateId];
        return (candidate.id, candidate.name, candidate.details, candidate.voteCount);
    }

    function isElectionActive(uint256 _electionId) 
        external 
        view 
        validElection(_electionId)
        returns (bool) 
    {
        return elections[_electionId].active;
    }

    // ============ ADMIN FUNCTIONS ============

    function setElectionStatus(uint256 _electionId, bool _active) 
        external 
        validElection(_electionId)
    {
        require(elections[_electionId].creator == msg.sender, "Only creator");

        elections[_electionId].active = _active;
        emit ElectionStatusChanged(_electionId, _active);
    }

    // ============ DATA CONSISTENCY CHECKS ============

    /**
     * @dev Emergency function to check data consistency
     */
    function checkVoterConsistency(uint256 _electionId, address _voter) 
        external 
        view 
        validElection(_electionId)
        returns (bool isConsistent, string memory issues) 
    {
        Voter memory voter = electionVoters[_electionId][_voter];

        if (!voter.exists) {
            return (true, "Voter not registered - consistent");
        }

        // Check for inconsistencies
        string memory problems = "";
        bool consistent = true;

        if (voter.status == VoterStatus.Voted && voter.votedFor == 0) {
            problems = string(abi.encodePacked(problems, "Status=Voted but votedFor=0; "));
            consistent = false;
        }

        if (voter.status == VoterStatus.Voted && voter.voteTimestamp == 0) {
            problems = string(abi.encodePacked(problems, "Status=Voted but no timestamp; "));
            consistent = false;
        }

        if (voter.votedFor != 0 && voter.status != VoterStatus.Voted) {
            problems = string(abi.encodePacked(problems, "Has vote but status != Voted; "));
            consistent = false;
        }

        if (voter.votedFor != 0 && !candidates[voter.votedFor].exists) {
            problems = string(abi.encodePacked(problems, "Voted for non-existent candidate; "));
            consistent = false;
        }

        return (consistent, consistent ? "All data consistent" : problems);
    }
}
